$(document).ready(function(){$(".fancybox").fancybox({nextEffect:'none',prevEffect:'none',helpers:{title:{type:'inside'}}});});function showImage(channelName,tRanges,imageType,captions){for(var tIndex in tRanges){var idBase=channelName+"_"+tRanges[tIndex];var fileBase=channelName+"-"+imageType+"-"+tRanges[tIndex];document.getElementById("a_"+idBase).href="plots/"+fileBase+".png";document.getElementById("a_"+idBase).title=captions[tIndex];document.getElementById("img_"+idBase).src="plots/"+fileBase+".png";document.getElementById("img_"+idBase).alt=fileBase+".png";};};function downloadCSV(csv,filename){var csvFile;var downloadLink;csvFile=new Blob([csv],{type:"text/csv"});downloadLink=document.createElement("a");downloadLink.download=filename;downloadLink.href=window.URL.createObjectURL(csvFile);downloadLink.style.display="none";document.body.appendChild(downloadLink);downloadLink.click();}
function exportTableToCSV(filename,tableId){var csv=[];var table=document.getElementById(tableId);var rows=table.querySelectorAll("table tr");for(var i=0;i<rows.length;i++){var row=[],cols=rows[i].querySelectorAll("td, th");for(var j=0;j<cols.length;j++)
row.push(cols[j].innerText);csv.push(row.join(","));}
downloadCSV(csv.join("\n"),filename);}